import styled from "styled-components";

const Head = styled.h1`
  display: flex;
  justify-content: center;
  align-items: center;
  color: #444;
`;

function Home() {
  return (
    <div>
      <Head>Bem-Vindo !!</Head>
    </div>
  );
}

export default Home;
